import{css} from "styled-components";

 
export const cardStyle=css`
padding:1rem 2rem 3rem 2rem;
border-radius:1rem;
background: rgba(240, 138, 201, 0.938);
color:white;

# a1 {
background: rgba(235, 232, 78, 0.938);
}
`
